import './TempUnitToggle.css';

const TempUnitToggle = (props) => {

    const { tempUnit, setTempUnit } = props;

    return (
        <div className="temp-unit-toggle-wrapper">
            <div className="temp-unit-toggle-container">
                <span className="temp-unit-metric" style={{color: tempUnit === "metric" && "white"}} onClick={() => setTempUnit("metric")}>C</span>
                <span className="temp-unit-imperial" style={{color: tempUnit === "imperial" && "white"}} onClick={() => setTempUnit("imperial")}>F</span>
            </div>
        </div>
    );
}

export default TempUnitToggle
